    const todos = [
        {id:1, name:"to do 1"},  
        {id:2, name:"to do 2"},
        {id:3, name:"to do 3"},
      ]
    return (
        <div>
            <ul className="list-group">
                {todos.map((todo, inddex)=>{
                        return <li class="list-group-item d-flex justify-content-between">
                            {todo.name}
                            <button className="btn btn-danger btn-sm">delete</button>
                        </li>
                    })
                }
            </ul>
        </div>
    )
}
export default TodoList;
